using System;
using System.Collections.Generic;
using System.Diagnostics;

using Xamarin.Forms;
using Xamarin.Forms.Xaml;
using SkiaSharp;
using SkiaSharp.Views.Forms;
using TouchTracking;
using System.IO;
using Xamarin.Forms.Internals;

namespace WorkingWithImages
{
    [XamlCompilation(XamlCompilationOptions.Compile)]
    public partial class FingerPaintPage : ContentPage
    {

        // These should be contrasting colors
        static readonly SKColor backgroundColor = SKColors.Black;
        static readonly SKColor crossHairColor = SKColors.White;

        Dictionary<long, SKPath> inProgressPaths = new Dictionary<long, SKPath>();
        List<SKPath> completedPaths = new List<SKPath>();
        double currentScale = 1, startScale = 1, xOffset = 0, yOffset = 0;

        // Current bitmap being drawn upon by user
        SKBitmap bitmap;
        SKCanvas bitmapCanvas;
        int bitmapSize;                 // bitmaps used here are always square

        SKPaint paint = new SKPaint
        {
            Style = SKPaintStyle.Stroke,
            Color = SKColors.Blue,
            StrokeWidth = 100,
            StrokeCap = SKStrokeCap.Round,
            StrokeJoin = SKStrokeJoin.Round
        };

        // Either SKCanvasView or SKGLView
        View canvasView;

        public FingerPaintPage()
        {
            InitializeComponent();
        }

        void OnTouchEffectAction(object sender, TouchActionEventArgs args)
        {
            switch (args.Type)
            {
                case TouchActionType.Pressed:
                    if (!inProgressPaths.ContainsKey(args.Id))
                    {
                        SKPath path = new SKPath();
                        path.MoveTo(ConvertToPixel(args.Location));
                        inProgressPaths.Add(args.Id, path);
                        canvas.InvalidateSurface();
                    }
                    break;

                case TouchActionType.Moved:
                    if (inProgressPaths.ContainsKey(args.Id))
                    {
                        SKPath path = inProgressPaths[args.Id];
                        path.LineTo(ConvertToPixel(args.Location));
                        canvas.InvalidateSurface();
                    }
                    break;

                case TouchActionType.Released:
                    if (inProgressPaths.ContainsKey(args.Id))
                    {
                        completedPaths.Add(inProgressPaths[args.Id]);
                        inProgressPaths.Remove(args.Id);
                        canvas.InvalidateSurface();
                    }
                    break;

                case TouchActionType.Cancelled:
                    if (inProgressPaths.ContainsKey(args.Id))
                    {
                        inProgressPaths.Remove(args.Id);
                        canvas.InvalidateSurface();
                    }
                    break;
            }
        }

        SKPoint ConvertToPixel(Point pt)
        {
            return new SKPoint((float)(canvas.CanvasSize.Width * pt.X / canvas.Width),
                               (float)(canvas.CanvasSize.Height * pt.Y / canvas.Height));
        }

        void OnCanvasViewPaintSurface(object sender, SKPaintSurfaceEventArgs args)
        {
            int width = 1150;
            string ImageData = "data:image/Jpeg;base64,";
            int height = 1800;
            // Get the canvas
            bitmapCanvas = args.Surface.Canvas;
            if (Device.OS == TargetPlatform.Android)
            {
                try
                {
                    using (var surface = SKSurface.Create(Convert.ToInt32(width), height, SKColorType.Rgb565, SKAlphaType.Premul))
                    {
                        //code to draw image
                        if (!string.IsNullOrEmpty(ImageData))
                        {
                            string strimg64 = ImageData.Split(',')[1];
                            if (!string.IsNullOrEmpty(strimg64))
                            {
                                byte[] imageBytes = Convert.FromBase64String(strimg64);
                                Stream fileStream = new MemoryStream(imageBytes);

                                // clear the canvas / fill with white
                                bitmapCanvas.DrawColor(SKColors.White);

                                // decode the bitmap from the stream
                                using (var stream = new SKManagedStream(fileStream))

                                    bitmap = SKBitmap.Decode(stream);
                                using (var paint = new SKPaint())
                                {
                                    bitmapCanvas.DrawBitmap(bitmap, SKRect.Create(width, height), paint);
                                }
                            }
                        }
                        foreach (SKPath path in completedPaths)
                        {
                            bitmapCanvas.DrawPath(path, paint);
                        }

                        foreach (SKPath path in inProgressPaths.Values)
                        {
                            bitmapCanvas.DrawPath(path, paint);
                        }
                    }
                }
                catch (Exception ex)
                {
                    throw ex;
                }
            }
            else if (Device.OS == TargetPlatform.iOS)
            {
                try
                {
                    using (var surface = SKSurface.Create(Convert.ToInt32(width), height, SKColorType.Rgb565, SKAlphaType.Premul))
                    {
                        //code to draw image
                        if (!string.IsNullOrEmpty(ImageData))
                        {
                            string strimg64 = ImageData.Split(',')[1];
                            if (!string.IsNullOrEmpty(strimg64))
                            {
                                byte[] imageBytes = Convert.FromBase64String(strimg64);
                                Stream fileStream = new MemoryStream(imageBytes);

                                // clear the canvas / fill with white
                                bitmapCanvas.DrawColor(SKColors.White);

                                // decode the bitmap from the stream
                                using (var stream = new SKManagedStream(fileStream))
                                using (bitmap = SKBitmap.Decode(stream))
                                using (var paint = new SKPaint())
                                {
                                    bitmapCanvas.DrawBitmap(bitmap, SKRect.Create(width, height), paint);
                                }
                            }
                        }
                        foreach (SKPath path in completedPaths)
                        {
                            bitmapCanvas.DrawPath(path, paint);
                        }

                        foreach (SKPath path in inProgressPaths.Values)
                        {
                            bitmapCanvas.DrawPath(path, paint);
                        }
                    }
                }
                catch (Exception ex)
                {
                    throw ex;
                }
            }
        }

        // Clear the bitmap of all user drawings.
        void OnClearButtonClicked(object sender, EventArgs args)
        {
            // Color the bitmap background, erasing all user drawing
            //canvas.Clear(backgroundColor);
        }

        // Save the bitmap to the phone's shared photo library
        async void OnSaveButtonClicked(object sender, EventArgs args)
        {
            try
            {
                // Get this SKImage data. This is basically an array of bytes in PNG format.
                SKData data = SKImage.FromBitmap(bitmap).Encode();

                // Fabricate a filename based on data and time.
                // NOTE: This filename is not used by iOS!
                DateTime dt = DateTime.Now;
                string filename = String.Format("SpinPaint-{0:D4}{1:D2}{2:D2}-{3:D2}{4:D2}{5:D2}{6:D3}.png",
                                                dt.Year, dt.Month, dt.Day, dt.Hour, dt.Minute, dt.Second, dt.Millisecond);

                // Get the dependency service implemented in the particular platform.
                ISaveChangesService dependencyService = DependencyService.Get<ISaveChangesService>();

                // Save the bitmap and get a boolean indicating success.
                bool result = await dependencyService.SaveBitmap(data.ToArray(), filename);

                // Display an alert if an error occurred.
                if (!result)
                {
                    await DisplayAlert("SpinPaint", "Artwork could not be saved. Sorry!", "OK");
                }
                // Display an alert if an error occurred.
                if (result)
                {
                    await DisplayAlert("SpinPaint", "Artwork successfully saved. Thanks!", "OK");
                }
            }
            catch (Exception ex)
            {

            }
        }
    }
}